def isPossible(nums):
    """
    :type nums: List[int]
    :rtype: bool
    """
    helper = dict()
    size = len(nums)
    for i in range(size):
        if nums[i] not in helper:
            helper[nums[i]] = 1
        else:
            helper[nums[i]] += 1

    index = nums[0]
    right = nums[-1]
    helper[right + 1] = 0

    tail = dict()

    while index <= right:

        if index not in helper or helper[index] == 0:
            index += 1
            continue
        num1 = index
        helper[num1] -= 1
        if num1-1 in tail:
            tail[num1-1]-=1
            if tail[num1-1]==0:
                del tail[num1-1]
            if num1 in tail:
                tail[num1]+=1
            else:
                tail[num1]=1
            continue

        num2 = index+1
        if num2>right or num2 not in helper or helper[num2]==0:
            return False
        else:
            helper[num2]-=1
        num3 = index+2
        if num3>right or num3 not in helper or helper[num3]==0:
            return False
        else:
            helper[num3]-=1
        if num3 not in tail:
            tail[num3]=1
        else:
            tail[num3]+=1
    return True


